import React, { Component } from 'react'
import Item from './Item'
import { collisionDetection } from './helper.js'


class Items extends Component {
    onmousedown = (listId) => {
        this.props.selectItem(listId)
    }

    render () {
        const { selectedItems, mousePosition } = this.props
        return (
            <React.Fragment>
                <Item key={1} listId={1} selectedItems={selectedItems} onmousedown={this.onmousedown} mousePosition={mousePosition}/>
                <Item key={2} listId={2} selectedItems={selectedItems} onmousedown={this.onmousedown} mousePosition={mousePosition}/>
                <Item key={3} listId={3} selectedItems={selectedItems} onmousedown={this.onmousedown} mousePosition={mousePosition}/>
           </React.Fragment>
        )
    }
}

export default Items
